import React from 'react';
import User from './User';

const Users = ({ users }) => {
    console.log(users);
    return ( 
        <>
        <table>
        <tr>
            <th>Company</th>
            <th>Contact</th>
            <th>Country</th>
        </tr>
        <tr>
            <td>Alfreds Futterkiste</td>
            <td>Maria Anders</td>
            <td>Germany</td>
        </tr>
        </table>
            {
                users.map((user) => (
                    <User user={user} />
            ))}
        </>
     );
}

export default Users;
